function getUserLocation(){navigator.geolocation.getCurrentPosition(setUserLocationCookie,alertNoGeolocation,{maximumAge:9e5})}function setUserLocationCookie(o){var e=o.coords.latitude+","+o.coords.longitude,t=new Date;t.setTime(t.getTime()+9e5);var i="expires="+t.toGMTString();document.cookie="detected_user_location="+escape(e)+"; "+i,$.ajax({type:"GET",url:"/dashboard",dataType:"script"})}function alertNoGeolocation(){}$(document).ready(function(){getUserLocation()});